DROP TABLE IF EXISTS `IAMS_SYS_CONS_CATALOG`;
CREATE TABLE `IAMS_SYS_CONS_CATALOG` (
  `SID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `CATALOGID` int(11) NOT NULL COMMENT '目录id',
  `CATALOGPID` int(11) DEFAULT NULL COMMENT '父级',
  `CONS_TYPE` int(11) DEFAULT NULL COMMENT '工程类别',
  `CONS_CODE` varchar(50) DEFAULT NULL COMMENT '工程资料代码',
  `CONS_NAME` varchar(100) DEFAULT NULL COMMENT '工程资料名称',
  `MATERIAL_NO` varchar(100) DEFAULT NULL COMMENT '施工技术资料编号',
  `MATERIAL_SOURCE` varchar(100) DEFAULT NULL COMMENT '工程资料来源',
  `ARC_COMPANY_TYPE` int(11) DEFAULT NULL COMMENT '归档单位类型',
  `ORDER_INDEX` int(11) DEFAULT NULL COMMENT '顺序号',
  `ISDIRECTORY` tinyint(1) DEFAULT NULL COMMENT '是否目录',
  `ARCHIVE_DIRECTORY_TYPE` int(11) DEFAULT NULL COMMENT '归档目录类别',
  `CREATED_BY` varchar(32) DEFAULT NULL COMMENT '创建者',
  `CREATED_DT` datetime DEFAULT NULL COMMENT '创建时间',
  `VERSION` int(9) DEFAULT NULL COMMENT '版本号',
  `UPDATED_BY` varchar(32) DEFAULT NULL COMMENT '更新者',
  `UPDATED_DT` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`SID`),
  UNIQUE KEY `SID_UNIQUE` (`SID`),
  UNIQUE KEY `CATALOGID_UNIQUE` (`CATALOGID`)
) ENGINE=InnoDB AUTO_INCREMENT=413 DEFAULT CHARSET=utf8 COMMENT='建设档案归档目录信息表';





























































































































































































































































































































































































































COMMIT;